import './App.css';
import Navbar from "./components/Navbar"
import Home from "./pages/Home"
import {BrowserRouter as Router, Route } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Router>
        <Navbar/>
        <Switch>
          <Route path="/" exact Component={Navbar}/>
        </Switch>
      </Router>

    </div>
  );
}

export default App;
